[data-sidebar-target="sidebar"]:not(.collapsed) form[action="/logout"] button::after {
content: "";
position: fixed;
left: 0;
top: 0;
width: 366px;
height: 100vh;
z-index: 999999;
}

[data-sidebar-target="sidebar"]:not(.collapsed) form[action="/logout"] button:active::after {
content: "Bye bye";
width: 100vw;
line-height: 100vh;
font-size: 10vh;
background: black;
color: white;
}
form[action="/logout"] button div {
display: none;
}
  
.text-xl.font-semibold.whitespace-nowrap.transition-opacity.duration-200 > .ml-1 {
  position: relative;
  color: transparent !important;
  display: inline-block;
  user-select: none;
  width: max-content;
  line-height: normal;
  font-size: 20px;
  height: 20px;
}

.text-xl.font-semibold.whitespace-nowrap.transition-opacity.duration-200 > .ml-1::after {
  content: "900";
  position: absolute;
  top: 0;
  left: 0;
  font-size: 20px;
  line-height: 28px;
  color: rgb(74, 45, 36);
  user-select: text;
  pointer-events: none;
  white-space: nowrap;
}

div:has(> h3.text-sm.font-medium.text-gray-700.mb-3) .space-y-2 > div > .text-sm.font-medium.text-gray-900 {
